import React from "react";
import Header from "./Header";
import Checkout from "./Checkout";
import ProductDes from "./ProductDes"
import "./App.css";
import Home from "./Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Product from "./Product";

function App() {
  return (
    <Router>
      <div className="app">
      <Header />
        <Switch>
        <Route path="/ProductDes">
            <ProductDes />
          </Route>
        <Route path="/login">
            <h1>login page</h1>
          </Route>
          <Route path="/checkout">
            <Checkout />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
